import React, { useState, useEffect } from "react";
import { Modal, Button } from "antd";

const edit01 = props => {
  useEffect(() => {
    console.log("MODAL !!", props);
  }, []);

  const { setEditVisible } = props;
  return (
    <>
      <button onClick={() => setEditVisible(false)}> 뒤로가기 </button>
      <div>EDIT</div>
    </>
  );
};

export default edit01;
